export default function Login() {

  return (
    <div>
      <Router>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <PrivateRoute path="/dashboard" element={<Dashboard />} />
        </Routes>
      </Router>
    </div>
  );

}
